	public function run()
	{

		$arr = $this->getArray();

		foreach ($arr as $a)
		{
			$ficha = new Ficha;
			$data_edicao = new \Carbon\Carbon;
			$str = ($a[2]);
			$data_edicao->year = substr($str, -4);
			$data_edicao->month = substr($str, -6, -4);
			if(substr($str, -8, -6) == '' || substr($str, -8, -6) == '00')
			{
				$data_edicao->day = '1';	
			}
			else
			{
				$data_edicao->day = substr($str, -8, -6);
			}

			$duracao_edicao = '0000-01-01';

			if (!$a[3])
			{
				$duracao_edicao = new \Carbon\Carbon;
				$str = ($a[3]);
				$duracao_edicao->year = substr($str, -4);
				$duracao_edicao->month = substr($str, -6, -4);
				if(substr($str, -8, -6) == '' || substr($str, -8, -6) == '00')
				{
					$duracao_edicao->day = '1';	
				}
				else
				{
					$duracao_edicao->day = substr($str, -8, -6);
				}
			}

			$ficha->assunto = $a[0];
			$ficha->periodico_id = $a[1] ?? 99999;
			$ficha->data_edicao = $data_edicao;
			$ficha->duracao_edicao = $duracao_edicao;
			$ficha->pagina = $a[4];
			$ficha->resumo = $a[5];
			$ficha->comentario = $a[6];
			$ficha->edicao = $a[7];
			$ficha->save();
		}
	}

