			['Hermann M. Goergen',29,'10091964',NULL,'6',NULL,'Herman M. Goergen, nascido em 23/12/1908, era judeu-alemão que emigrou para Juiz de Fora em 1941. Chegou no Rio de Janeiro em 11/5/1941 com outros judeus-alemães fugindo do nazismo. Em novembro de 1941 fundou a INTEC Gráfica, na avenida Francisco Bernardino, Centro da cidade. Retornou para a Alemanha em 1954. Em 1958 e 1964 esteve no Brasil. Faleceu em Bonn, em 03/5/1994.',NULL],
			['Hermenegildo Villaça [Hermenegildo Rodrigues Villaça], médico',NULL,NULL,NULL,NULL,'Foto da residência do Dr. Hermenegildo Villaça, no largo [da igreja] de São Sebastião.','Nascido em 1860 e falecido em 1936, foi médico cirurgião pioneiro na cirurgia em Minas Gerais. Exerceu parte de sua atividade profissional na Santa Casa de Misericórdia de Juiz de Fora. H. Villaça fundou a Faculdade de Medicina de Juiz de Fora e a Companhia de Laticínios de Juiz de Fora; presidiu a Sociedade de Medicina e Cirurgia de Juiz de Fora, foi cafeicultor e pecuarista. ',NULL],
