			['Jornada dos Mártires, tela de Antônio Parreiras',13,'22031928',NULL,'3','Antônio Parreiras expõe seus trabalhos no Elite Club, em Juiz de Fora.','Neste período Antônio Parreiras foi a Matias Barbosa se "inspirar" para pintar o quadro "Jornada dos Mártires"; trabalho encomendado pelo presidente da Câmara dos Vereadores de Juiz de Fora. Segundo Levi o trabalho foi entregue em novembro de 1928. A Professora Maraliz Christo, da UFJF, afirma que a tela estava exposta na Câmara Municipal em abril de 1929.  Atualmente compõem o acervo do Museu Mariano Procópio. Este trabalho de Antônio Parreiras é muito reproduzida em livros didáticos.',NULL],
